import React, { Fragment } from "react"
import classes  from './Header.module.css'
import meals from '../../assets/meals.jpeg';

const Header =  props => {
    return(
        <Fragment>
        <header className= {classes.header}>
        <h1> React meals</h1>
        <button>Cart </button>
        </header>
        <div className = {classes['main-image']}>
            <img  src = {meals}/>
        </div>
        </Fragment>
    )

}

export default Header;
